import ReactDOM from 'react-dom';
import React from 'react';
import { Link } from 'react-router-dom';
import Avatar from './avatar.jpg'; 
import { DesktopMacTwoTone } from '@material-ui/icons';

const Contentarea = () => {
    return(
        <>
           <div  className="contentArea">
               <div className="msgBox">
                    <img src={Avatar} alt="avatar" className="img_avatar" />
                    <h1>Welcome Our BeSingular Buddy Bot Is Here To Guide You.</h1>
                    <Link to="/" onClick={guideMe} className="btn btn-info">Click Me!</Link>
               </div>
            </div> 
        </>
    );
}
const guideMe = () => { 
    var element = document.getElementById("guideBox");
    element.classList.add("ShowGuide");    
    var element2 = document.getElementById("Leadership");
    element2.classList.css('z-index',99);     
}
export default Contentarea;
